import { takeLatest, call, put } from 'redux-saga/effects'
import axios from 'axios';
import config from "./../config/index"

function uploadApi(data,url){
  return axios({
    method: "POST",
    url: `${config.baseUrl}/api/del-image`,
    data : data
  });
}

function* signupFlow(action){
  const { data } = action.data
  console.log(action.data);
  try {
    const response = yield call(uploadApi,data); 
    const data = response.data;
    console.log(data)
    yield put({ type: "DEL_SUCCESS", data })
  } catch(error){
    yield put({ type: "UPLOAD_ERROR", error })
  }
}

export function* watchDelImage() {
  yield takeLatest("API_DEL_IMAGE", signupFlow);
}
